import React, {useState} from 'react';
import axios from 'axios';

const Main = () => {
    const [art, setArt] = useState(0);

    axios.get(`https://www.rijksmuseum.nl/api/nl/collection?key=rirqQnx4`)
      .then(res => {
        const response = res.data;
        console.log(response);
        setArt(response);
      })
  return (
    <div>Main</div>
  )
}

export default Main
